import {endTrip} from '../firebase/firebase.utils'

export default class EndTrip extends Component {
    render() {


        const closeAndMigrateTrip = async (userID, tripID) => {

           let email = await endTrip(userID, tripID)
           console.log(email)
        }

        return (
            <div>
                <button onClick={()=>closeAndMigrateTrip(this.props.currentUser.id, this.props.currentUser.currentTrip )} >Close all groups!</button>
            </div>
        )
    }
}
